import Register from "./components/register";
import Login from "./components/login";
import { Link, Routes } from "react-router-dom";

function App() {
  return (
    <main className="App">
      <Routes>
        <Route patt="/" />
      </Routes>
      <Login />
    </main>
  );
}

export default App;
